       constructor(props){
        super(props);
        this.n = props.n;
        this.child = this.creat();
       }
    
       creat(){
        let ele = (
         <div>   
            <Cores/>
            <Titulo tit = {"FATECS"} text = {"Faculdade de tecnologia"} link= {"https://www.vestibularfatec.com.br/home/"}/>
            <Titulo2/>
            <Tabuada n = {this.n}/>
        </div>
        )

        return ele; };

        render(){
            return this.child;
        }

            
};
